import React, { useState } from 'react';
import {
  StyleSheet,
  Text,
  View,
  TextInput,
  TouchableOpacity,
} from 'react-native';

const SignupScreen = () => {
  const onPressSignup = () => {
    // Do something about signup operation
  };

  const [state, setState] = useState({
    email: '',
    password: '',
    confirmPassword: '',
  });

  return (
    <View style={styles.container}>
      <Text style={styles.title}>Signup Screen</Text>
      <View style={styles.inputView}>
        <TextInput
          style={[styles.inputText, styles.emailInput]}
          placeholder="Email"
          placeholderTextColor="#003f5c"
          onChangeText={(text) => setState({ ...state, email: text })}
        />
      </View>
      <View style={styles.inputView}>
        <TextInput
          style={[styles.inputText, styles.passwordInput]}
          secureTextEntry
          placeholder="Password"
          placeholderTextColor="#003f5c"
          onChangeText={(text) => setState({ ...state, password: text })}
        />
      </View>
      <View style={styles.inputView}>
        <TextInput
          style={[styles.inputText, styles.passwordInput]}
          secureTextEntry
          placeholder="Confirm Password"
          placeholderTextColor="#003f5c"
          onChangeText={(text) => setState({ ...state, confirmPassword: text })}
        />
      </View>
      <TouchableOpacity onPress={onPressSignup} style={styles.signupBtn}>
        <Text style={styles.signupText}>SIGN UP</Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#4FD3DA',
    alignItems: 'center',
    justifyContent: 'center',
  },
  title: {
    fontWeight: 'bold',
    fontSize: 50,
    color: '#fb5b5a',
    marginBottom: 40,
  },
  inputView: {
    width: '80%',
    backgroundColor: '#3AB4BA',
    borderRadius: 25,
    height: 50,
    marginBottom: 20,
    justifyContent: 'center',
    padding: 20,
  },
  inputText: {
    height: 50,
    color: 'white',
  },
  emailInput: {
    fontSize: 18,
  },
  passwordInput: {
    fontSize: 18,
  },
  signupBtn: {
    width: '80%',
    backgroundColor: '#fb5b5a',
    borderRadius: 25,
    height: 50,
    alignItems: 'center',
    justifyContent: 'center',
    marginTop: 40,
  },
  signupText: {
    color: 'white',
    fontSize: 20,
  },
});

export default SignupScreen;
